	ng-class="bodyClass"

	<!--
		This is the initial loading sequence. We need to be able to display this BEFORE the AngularJS
		framework loads in order to give the user some sence of activity. But, when the framework kicks
		in, it will be able to use the bound ng-controller.
	-->
	<!-- BEGIN: Loading Sequence. -->
	<div ng-if="isLoadingOpen" ng-controller="loading.LoadingController" inv-loading-sequence class="m-loading">

		<!-- BEGIN: Loading Indicator. -->
		

			<div class="loading-backdrop">

				<div class="loading-container">

					<div class="status-container">

						<div class="status"></div>
						<div class="logo"></div>

					</div> <!-- status-container -->

					<h2>Loading Experience</h2>

					<p>
						Powered by <a href="http://www.InVisionApp.com/" target="_blank">InVision</a>

						
							, the best way to share and collaborate on design.
						

					</p>

				</div> <!-- loading-container -->

				<div class="loading-footer">

					<div class="logo"></div>

					<h3><a href="http://www.InVisionApp.com/" target="_blank">Powered by InVision</a></h3>

					
						<p><em>Prototyping, Collaboration &amp; Workflow for Designers</em></p>
					

				</div> <!-- loading-footer -->

			</div> <!-- loading-backdrop -->

		
		<!-- END: Loading Indicator. -->

	</div>
	<!-- END: Loading Sequence. -->

	<div ng-include=" '/assets/apps/share/views/partials/preload.htm' "></div>
	<div ng-include=" '/assets/apps/share/views/layouts/modal.htm' "></div>
	<div ng-include=" '/assets/apps/share/views/toolbar/toolbar.htm' "></div>
	<div ng-include=" '/assets/apps/share/views/powered-by/powered-by.htm' "></div>

	<div
		ng-if="isBrowseOpen"
		ng-include=" '/assets/apps/share/views/browse/browse.htm' "></div>

	<!-- In order to be able to disable horizontal scrolling for some screens, we need to wrap the view in order to be able to maintain screen alignment -->

	<div class="desktop-wrapper">

		<!-- Tour Points -->
		<div
			ng-if=" subview == 'preview' "
			ng-include=" '/assets/apps/share/views/preview/preview-tour-comments.htm' "></div>

		<div
			ng-if="subview == 'comments'"
			ng-include=" '/assets/apps/share/views/comments/comments.htm' "></div>

		<div
			ng-if="subview == 'preview'"
			is-share-loaded="{{!isLoadingOpen}}"
			inv-preview-auto-redirect-listener
			ng-include=" '/assets/apps/share/views/preview/preview.htm' "></div>

		<!-- Screens for comment mode -->
		<div
			ng-show="subview == 'comments'"
			ng-include=" '/assets/apps/share/views/screens/screens.htm' "c></div>

	</div>

	<script type="text/ng-template" id="/assets/apps/share/views/presentations/slides.htm"><div ng-switch on="subview">
<div ng-switch-when="comments">
<div 
id="comments_bar" 
ng-controller="toolbar.ToolbarController"
ng-hide="isShowingSketchBuilder">
<h2>Click anywhere on the image to leave a comment</h2>
<p class="close"><a ng-click="switchToPreview()">Close</a></p>
</div> <!-- share_bar -->
</div>
</div>
<!-- desktop projects -->
<div 	
ng-if=" !project.isMobile || subview == 'comments' "
inv-screens
ng-controller="screens.ScreensController"
class="m-screens desktop"
ng-style="bodyStyle"
ng-class="{ 
isScaledCommentMode: project.isMobile,
'comment-mode': subview == 'comments'
}">
<div 
class="screen visible {{ screen.alignment }}"
ng-style="{ 
width: ( (screen.width * screen.displayScale) + 'px' ), 
height: ( (screen.height * screen.displayScale) + 'px' ) 
}">
<img 
ng-src="{{ getScreenUrl() }}"
ng-style="{ 
width: ( (screen.width * screen.displayScale) + 'px' ), 
height: ( (screen.height * screen.displayScale) + 'px' ) 
}" />
</div>
</div>
<!-- mobile projects-->
<div 	
ng-if=" project.isMobile && subview == 'preview' "
class="m-screens" >
<div class="screen mobile visible {{ screen.alignment }}">
<img ng-src="{{ getScreenUrl() }}" />
</div> <!-- screen mobile visible -->
</div> <!-- m-screens -->
</script><script type="text/ng-template" id="/assets/apps/share/views/toolbar/toolbar.htm">
<div
ng-controller="toolbar.ToolbarController"
ng-show="( includeBrowseTool || includeCommentsTool )"
ng-mouseenter="updateIsUserOverToolbar( true )"
ng-mouseleave="updateIsUserOverToolbar( false )"
ng-hide="share.isEmbed"
ng-class="{ 'tour-is-running': isShareTourRunning }"
class="m-toolbar">
<!-- iPhone projects -->
<div
id="shareSMS"
inv-fade-show="isShowingSmsForm"
ng-if=" deviceTemplate.deviceType == 'phone' && !! shareUrl "
ng-class="{
'no-comments': ! includeCommentsTool,
'no-browse': ! includeBrowseTool
}">
<div class="smsForm" inv-fade-show="isShowingSmsForm" duration="slow" >
<a ng-click="toggleSmsShareForm()" class="closeButton"><img src="assets/apps/share/img/close4.png" alt="Close" /></a>
<h2>Install "{{ project.name }}" on your phone</h2>
<p>Visit <a ng-href="{{ shareUrl }}">{{shareUrl}}</a> on your phone or SMS the link to your number:</p>
<input 	inv-i8n-telephone
type="text"
class="phoneNumber"
country-code="share.countryCode"
ng-class="{ messageSent: sms.messageSent }"
ui-keypress="{13:'sendShareSms()'}"
name="phoneNumber"
placeholder="Enter mobile number"
ng-model="sms.phoneNumber">
<button ng-click="sendShareSms()">
Send
</button>
<div class="message">
{{sms.message}}
</div>
</div>
</div>
<!-- BEGIN: Toolbar. -->
<div
inv-toolbar
class="toolbar"
ng-class="{
active: isActive,
'highlight-tour': !hasSeenTour
}">
<!-- helper -->
<div
class="begin-share-tour"
ng-show=" false "
>
<!-- bouncy tooltip -->
<div
class="comment-tip-wrapper"
ng-show="shouldShowBounceToolTip()">
<span
inv-bouncy-tooltip
msg="Learn how to explore this design"
callback="hasSeenCommentTooltip()"></span>
</div> <!-- comment-tip-wrapper -->
<div class="helper" ng-class="{'hasSeenCommentsTooltip': hasSeenCommentsTooltip}" ng-click="showShareTour()">?</div>
</div> <!-- begin-share-tour -->
<!-- AQUA-421 comment cta tooltip -->
<div
class="comments-cta-tooltip"
ng-class="{ transition: commentToolTipVisible }"
ng-if="includeCommentsTool">
<div class="popover top comments-tip">
<div class="arrow"></div>
<div class="popover-content">
<i ng-click="closeCommentTooltipExperiment()" class="comments-tooltip-close"></i>Turn on comment mode to collaborate on this prototype
</div>
</div>
</div> <!-- comment cta tooltip -->
<div class="tools">
<div ng-if=" deviceTemplate.deviceType == 'phone' && !! shareUrl " class="tool share-sms-tool">
<a ng-click="toggleSmsShareForm()"><span class="toolbar-menu-device"></span></a>
</div>
<div
ng-show="includeBrowseTool"
ng-class="{ active: tourSubView == 'thumbnails' }"
class="tool browse-toggle-tool">
<a ng-click="toggleBrowse()" ng-class="{ on: isBrowseOpen }"><span class="toolbar-menu-sprite"></span></a>
</div>
<div
ng-show="includeCommentsTool"
ng-class="{
active: tourSubView == 'comments',
'no-browse': !includeBrowseTool && ( deviceTemplate.deviceType != 'phone' )
}"
class="tool comments-toggle-tool">
<div class="clickable"></div>
<span class="description">
<i ng-if="!unreadCommentCount" class="comment-count-old"></i><i ng-if="unreadCommentCount" class="comment-count-new"></i>&nbsp;{{ commentCount }}&nbsp;Comments
</span>
<div ng-model="isShowingComments" inv-toggle></div>
</div>
</div>
</div>
<!-- END: Toolbar. -->
</div>
</script><script type="text/ng-template" id="/assets/apps/share/views/comments/markers.htm"><div
ng-controller="comments.MarkersController"
inv-comments-markers
class="markers" >
<div
ng-class="{ mobile: project.isMobile }"
class="viewport {{ viewport.alignment }}"
ng-style="{
width: ( viewport.width + 'px' ),
height: ( viewport.height + 'px' )
}"
ng-mouseenter=" setIsHoveringViewport(true) "
ng-mouseleave=" setIsHoveringViewport(false) ">
<!-- Output the conversation markers. -->
<a
ng-repeat="conversation in conversations track by conversation.id"
ng-href="#/screens/{{ screenID }}/comments/{{ conversation.id }}"
class="marker"
ng-class="{
complete: conversation.isComplete,
active: ( conversation == selectedConversation ),
comment: ! conversation.isForDevelopment && ! conversation.isTourPoint && ! conversation.isPrivate,
'dev-note': conversation.isForDevelopment,
'tour-point': conversation.isTourPoint,
'private-comment': conversation.isPrivate && ! conversation.isForDevelopment,
read: ! conversation.isUnread && userAuthenticated,
'move-disabled': !isUserACollaborator,
'no-label': conversation.label == ''
}"
ng-style="{

ng-click="editComment( comment )"

Edit
</a>
</li>

inv-comment

tabindex="102"

Save

</div>
</span>
</div>

<div inv-fade-show="isIdentifying" class="overlay identification">
<div class="form">
<h2>Let us know who you are</h2>
<h3>In order to leave a comment, we need to know who you are.</h3>
<div ng-show="errorMessage" class="alert alert-error">
{{ errorMessage }}
</div>
<div class="field" ng-class="{ 'defined': identity.name.length }">
<input
type="text"
id="identity.name"
ng-model="identity.name"
inv-autofocus
tabindex="301"
/>
<label for="identity.name">
Your name
</label>
</div>
<div class="field" ng-class="{ 'defined': identity.email.length }">
<input
type="text"
id="identity.email"
ng-model="identity.email"
tabindex="302"
/>
<label for="identity.email">Email address</label>
</div>
<div class="actions">
<button
class="close"
type="button"
ng-click="selectTourPoint(null)"
>
Cancel
</button>
<button
class="button"
type="button"
ng-click="submitForm({ comment: newComment, sketches: tempSketches })"
tabindex="303"
>
Submit
</button>
</div>
</div> <!-- /form -->
</div> <!-- /identification -->
<div inv-fade-show="isAuthenticating" class="overlay authentication">
<div class="form">
<h2>We've recognized that account, what's the password?</h2>
<h3>Enter your password to leave a comment</h3>
<div class="field" ng-class="{ 'defined': identity.name.length }">
<input
type="password"
id="identity.password"
ng-model="identity.password"
inv-autofocus
tabindex="301"
/>
<label for="identity.name">
Password
</label>
</div>
<div
ng-show="errorMessage"
class="alert alert-error"
ng-bind-html="errorMessage"
>
</div>
<div class="actions">
<button
class="close"
type="button"
ng-click="selectTourPoint(null)"
>
Cancel
</button>
<button
class="button"
type="button"
ng-click="submitFormPassword()"
tabindex="302"
>
Post Comment
</button>
</div>
</div> <!-- form -->
</div> <!-- authentication -->
</div>
</section>
</div> <!-- comment-thread-container -->
</form>
</script><script type="text/ng-template" id="/assets/apps/share/views/preview/preview.htm"><div

ng-if="project.isMobile"
inv-mobile-transition-layer
id="mobile_transition_layer"
class="{{ deviceTemplate.className }} {{ chromeClass }}"></div>

<div class="slideshow-status" ng-show=" ! project.isMobile " >{{ currentScreenIndex }} of {{ screenCount }}</div>

</script><script type="text/ng-template" id="/assets/apps/share/views/preview/browser-compatibility.htm"><a ng-click="closeBrowserCompatibilityAlert()" class="browser-overlay">

We're sorry, your browser isn't fully supported to display this content properly.
</h1>
<div ng-switch="browserCompatibility.reason">
<p ng-switch-when="version">
We encourage you to <a href="http://browsehappy.com" target="updateBrowser">upgrade to a modern web browser</a>.
</p>
<p ng-switch-when="mode">
Looks like you're running in &quot;compatibility mode&quot;, simply follow these

</p>
</div>
<a ng-click="closeBrowserCompatibilityAlert()" class="no-thanks">
No thanks, continue...
</a>
</div></script><script type="text/ng-template" id="/assets/apps/share/views/preview/preview-tour-comments.htm"><div ng-controller="preview.TourCommentsController">

class="rendering" />
</div>
<div class="excerpt" ng-bind-html="tooltipExcerpt()"></div>
</div>
<!-- Only include the form if a tour point has been selected.-->
<div

</div>
<!--  View controlled by switch to overlay everything -->
<div inv-share-sketch-builder
ng-if=" isShowingSketchBuilder " >
</div>
<!-- Sketch viewer modal-->
<div inv-share-sketch-viewer
ng-if=" isShowingSketchViewer ">
</div>
</div>
</div>
</script><script type="text/ng-template" id="/assets/apps/share/views/directives/share-sketch-viewer.htm"><div id="shareSketchViewer"  ng-show=" isShowingSketchViewer ">

<div  class="sketchViewer">

<img src="assets/apps/share/img/draw.png"/><br/>

<span class="sub">It'll be available shortly!</span>
</p>
</div>

<div ng-if=" !sketchViewerSketchIsTemp " class="imageContainer">

height: screen.height * screen.displayScale + 'px'

<div class="tempSketchOverlay" ng-bind-html=" sketchViewerSketch.svg ">
</div>
</div>
</div>
</div>
</div></script><script type="text/ng-template" id="/assets/apps/share/views/directives/toggle.htm">

</span>

</div>

</script><script type="text/ng-template" id="/assets/apps/common/views/directives/mobile-transition-layer.htm"><div class="inner">
<div class="inner2">
<div
id="current-screen"
class="current-screen"
ng-if="currentScreen"
ng-style="{
'background-color': getBackgroundColor(currentScreen)
}">
<img
ng-src="{{ getImageUrl( currentScreen.imageUrl ) }}"
height="{{ Math.round(currentScreen.height * (currentScreen.displayScale || screen.displayScale)) }}"
width="{{ Math.round(currentScreen.width * (currentScreen.displayScale || screen.displayScale)) }}" />
<div
class="fixed-header"
ng-style="{
height: (currentScreen.fixedHeaderHeight * (currentScreen.displayScale || screen.displayScale)),
marginTop: pushDownFixedHeader
}">
<img
ng-src="{{ getImageUrl( currentScreen.imageUrl ) }}"
height="{{ Math.round(currentScreen.height * (currentScreen.displayScale || screen.displayScale)) }}"
width="{{ Math.round(currentScreen.width * (currentScreen.displayScale || screen.displayScale)) }}" />
</div>
<div
class="fixed-footer"
ng-style="{
height: (currentScreen.fixedFooterHeight * (currentScreen.displayScale || screen.displayScale))
}">
<img
ng-src="{{ getImageUrl( currentScreen.imageUrl ) }}"
height="{{ Math.round(currentScreen.height * (currentScreen.displayScale || screen.displayScale)) }}"
width="{{ Math.round(currentScreen.width * (currentScreen.displayScale || screen.displayScale)) }}" />
</div>
</div>
<div
id="next-screen"
ng-if="targetScreen"
class="target-screen"
ng-style="{
'background-color': getBackgroundColor(targetScreen)
}">
<img
ng-src="{{ getImageUrl( targetScreen.imageUrl ) }}"
height="{{ Math.round(targetScreen.height * (targetScreen.displayScale || screen.displayScale)) }}"
width="{{ Math.round(targetScreen.width * (targetScreen.displayScale || screen.displayScale)) }}" />
<div
class="fixed-header"
ng-style="{
height: (targetScreen.fixedHeaderHeight * (targetScreen.displayScale || screen.displayScale)),
marginTop: pushDownFixedHeader
}">
<img
ng-src="{{ getImageUrl( targetScreen.imageUrl ) }}"
height="{{ Math.round(targetScreen.height * (targetScreen.displayScale || screen.displayScale)) }}"
width="{{ Math.round(targetScreen.width * (targetScreen.displayScale || screen.displayScale)) }}" />
</div>
<div
class="fixed-footer"
ng-style="{
height: (targetScreen.fixedFooterHeight * (targetScreen.displayScale || screen.displayScale))
}">
<img
ng-src="{{ getImageUrl( targetScreen.imageUrl ) }}"
height="{{ Math.round(targetScreen.height * (targetScreen.displayScale || screen.displayScale)) }}"
width="{{ Math.round(targetScreen.width * (targetScreen.displayScale || screen.displayScale)) }}" />
</div>
</div>
<div
id="transition-picture-{{picture.id}}"
ng-repeat="picture in transitionScreens track by picture.id"
ng-style="{
'background-color': getBackgroundColor(picture)
}"
ng-class="{
'current-screen': picture.id == transitionScreen.id,
'target-screen': picture.id == transitionData.targetScreen.id
}"
class="transition-picture">
<img
ng-src="{{ getImageUrl( picture.imageUrl ) }}"
height="{{ Math.round(picture.height * (picture.displayScale || screen.displayScale)) }}"
width="{{ Math.round(picture.width * (picture.displayScale || screen.displayScale)) }}" />
<div
class="fixed-header"
ng-style="{
height: (picture.fixedHeaderHeight * (picture.displayScale || screen.displayScale)),
marginTop: pushDownFixedHeader
}">
<img
ng-src="{{ getImageUrl( picture.imageUrl ) }}"
height="{{ Math.round(picture.height * (picture.displayScale || screen.displayScale)) }}"
width="{{ Math.round(picture.width * (picture.displayScale || screen.displayScale)) }}" />
</div> <!-- fixed-header -->
<div
class="fixed-footer"
ng-style="{
height: (picture.fixedFooterHeight * (picture.displayScale || screen.displayScale))
}">
<img
ng-src="{{ getImageUrl( picture.imageUrl ) }}"
height="{{ Math.round(picture.height * (picture.displayScale || screen.displayScale)) }}"
width="{{ Math.round(picture.width * (picture.displayScale || screen.displayScale)) }}" />
</div> <!-- fixed-footer -->
</div> <!-- current-picture -->
</div><!-- inner2 -->
</div> <!-- inner -->
</script> 


</body>
</html>
